import React from "react";
import { elements } from "./_color";

const ColorCodes = ({ toShowEls }) => {
  const colorMap = [];
  for (let i of elements) {
    if (i["symbol"] in toShowEls) {
      colorMap.push(i);
    }
  }
  return (
    <div>
      {colorMap.map((i) => {
        return 2;
      })}
      }
    </div>
  );
};

export default ColorCodes;
